import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import MyNavbar from './components/Navbar';
import MyProfil from './components/Profil';
import MyProjectCard from './components/Projets';
import Mytest from "./components/test";


function App() {
  return (
    <header>
    <div className="App">
      <div>
      <MyNavbar />
      <MyProfil />
      {/* <MyProjectCard /> */}
      <Mytest />
      </div>
    </div>
    </header>
  );
}

export default App;
